import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {

  const Button = ({style}) =>
  {
    return(
      <button type="button" class= {style} >
      </button>

    )
  }

  // if screen = "homescreen"
  return (
    <div className="App">
      <header className="App-header">
          Grace Elias
      </header>
      <section class="button_container">
        <Button style = {"home_button"}>Test</Button>
        <Button style = {"resume_button"}>Test</Button>
        <Button style = {"projects_button"}>Test</Button>
        <Button style = {"experience_button"}>Test</Button>
        <Button style = {"about_me_button"}>Test</Button>
      </section>
    </div>
  );
}

export default App;
